import React, { Component } from "react";
import { EmptyState, Layout, Page } from "@shopify/polaris";

class Index extends Component {
  render() {
    return (
      <Page>
        <Layout>
          <EmptyState
            heading="Create helpful quizes for your customer"
            action={{
              content: "Get Started",
              onAction: () => {
                console.log("clicked");
              }
            }}
          />
        </Layout>
      </Page>
    );
  }
}

export default Index;
